import React, { useState, FormEvent } from "react";
import { BaseCrudService } from "../../../base/BaseCrudService";
import { useHistory } from "react-router-dom";
import { ISubject } from "../../../domain/ISubject";


const SubjectCreate = () => {
    const history = useHistory();
    const [props, setState] = useState({} as ISubject);

    const handleChange = (target: EventTarget & HTMLInputElement) => {
        setState({ ...props, [target.name]: target.value });
    }

    const handleSubmit = (e: FormEvent<HTMLFormElement>) => {

        BaseCrudService
            .createEntity(props, 'subjects')
            .then(data => history.push('/subjects'));

        e.preventDefault();
    }

    return (
        <form onSubmit={handleSubmit}>
            <div className="form-group">
                dumbo
                <input value={props.name} name="name" onChange={(e) => handleChange(e.target)} />
            </div>
            <button type="submit">Submit</button>
        </form>
    );
}

export default SubjectCreate;
